NUOMOJAMA POŽEMINĖ ŠILTA PARKAVIMO VIETA NAUJOS STATYBOS A+ KLASĖS PROJEKTE "KAPSŲ 3"!

VIETĄ GALIMA PRITAIKYTI IR DAIKTŲ SANDĖLIAVIMUI.
SAUGOMA KAMEROMIS IR AUTOMATINIAIS ĮVAŽIAVIMO VARTAIS.

Parkavimo vieta yra -1 aukšte, Nr. 24
Namo teritorija stebima vaizdo kameromis.
Puikiai išvystyta infrastruktūros vieta: visai šalia viešojo transporto stotelės, prekybos centrai, mokymo bei gydymo įstaigos.
Vos keletas minučių pėsčiomis ir minsite jaukiomis Senamiesčio gatvelėmis, kur verda kultūrinis gyvenimas kasdieną!

